import React from 'react'
import styled from 'styled-components'
const Body = styled.body`
    text-align:center;
`
const H1 = styled.h1`
    /* */
`

const Catalog = styled.div`
    display:inline;
    text-align:center;
    margin: 10px;
    padding: 10px;
`

export default class Content extends React.Component{
    render(){
        return(
            <Body>
                <img src="/static/images/pic1.jpg" alt="king" width="100" height="50"/>
                <img src="/static/images/queenandking.jpg" alt="king" width="100" height="50"/>
                <img src="/static/images/kingandboat.jpg" alt="king" width="100" height="50"/>
                <img src="/static/images/kingandpipe.jpg" alt="king" width="100" height="50"/>
                <img src="/static/images/kingandfufu.jpg" alt="king" width="100" height="50"/>
                <img src="/static/images/kingandoldkinggun.jpg" alt="king" width="100" height="50"/>
                <img src="/static/images/kingandgun.jpg" alt="king" width="100" height="50"/>
                <img src="/static/images/kingandfathergun.jpg" alt="king" width="100" height="50"/>
                <img src="/static/images/kingplantrice.jpg" alt="king" width="100" height="50"/>
            </Body>
        )
    }
}
